import axios from "axios";
import React, { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";
import { removeUserSession } from "./Utils/Common";
import { TimeoutLogic } from "./Utils/TimeoutLogic";

function Dashboard() {
  const [data, setData] = useState("");
  const navigate = useNavigate();

  const userdata = {
    "student_admissions_id": 1013
  }

  const headers = {
    'Content-Type': 'application/json',
    'Authorization': `Bearer${'eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJyZXN1bHQiOnsiaWQiOjEsIm5hbWUiOiJBZG1pbiIsImVtYWlsIjoiYWRtaW5AZ21haWwuY29tIiwiZW1haWxfdmVyaWZpZWRfYXQiOm51bGwsInJlbWVtYmVyX3Rva2VuIjpudWxsLCJjcmVhdGVkX2F0IjpudWxsLCJ1cGRhdGVkX2F0IjpudWxsLCJyb2xlIjoiYWRtaW4iLCJwYXNzd29yZF9kaWdlc3QiOm51bGx9LCJpYXQiOjE2Njc5OTAzNTgsImV4cCI6MTY2Nzk5NzU1OH0.Yi6IqtALDGyRjWtsnp_OeZJugGFa4FR5VAjc03BLKMU'}`
  }

  useEffect(() => {
    axios   .post(
        "https://7052-103-141-51-42.in.ngrok.io/api/v1/studentProfile",
        userdata,
        { headers: headers }
      )
      .then((res) => {
        setData(res.data.data[0]);
      });
  },);
  console.log("value", data.DOB);

  const handleLogout = () => {
    removeUserSession();
    navigate("/");
  };

  return (
    <div className="container log bg-dark text-white">
      <h1>{data.DOB}</h1>
      Welcome to Dashboard !<br />
      <br />
      <input
        type="button"
        className=" btn btn-primary"
        onClick={handleLogout}
        value="Logout"
      />
      <TimeoutLogic />
    </div>
  );
}

export default Dashboard;
